import React, { PureComponent } from 'react';
import styles from './statsCard.module.css'

export default class StatsCard extends PureComponent {
    render() {
        const {costPerPost, approval} = this.props

        return (
            <div className={styles['card'] + " " + styles['stats-card']}>
                <div className={styles['stat']}>
                    <p className={styles['stat-title']}>Estimated Cost per Post</p>
                    <p className={styles['stat-number']}>{costPerPost}</p>
                </div>
                <div className={styles['stat']}>
                    <p className={styles['stat-title']}>Our Rating</p>
                    <p className={styles['stat-number']}>{approval}%<span className={styles['approval']}>approval</span></p>
                </div>
            </div>
        );
    }
}
